    'seccion-17.505': {value: '\t\r\u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u062A\u0627\u0644\u064A\u0629 \u0644\u0639\u0631\u0636 \u0627\u0644\u0642\u0648\u0627\u0626\u0645 \u0627\u0644\u062A\u064A \u0644\u062F\u064A\u0643 \u062D\u0627\u0644\u064A\u0627 \u0646\u0634\u0627\u0637\u0627 \u0639\u0644\u0649 \u0627\u0644\u0645\u0648\u0642\u0639.<br /> \u062A\u062D\u0631\u064A\u0631 \u0627\u0648 \u0627\u0632\u0627\u0644\u0629 \u0642\u0627\u0626\u0645\u0629 \u0639\u0646 \u0637\u0631\u064A\u0642 \u0627\u062E\u062A\u064A\u0627\u0631 \u0627\u0644\u0632\u0631 \u0627\u0644\u0645\u0644\u0627\u0626\u0645 \u0644\u0644\u062D\u0642.<br /><br />\u0645\u0644\u0627\u062D\u0638\u0647 : \u0645\u062F\u064A\u0631 \u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062C \u0642\u062F \u0648\u0636\u0639\u062A \u0642\u064A\u0648\u062F \u0639\u0644\u0649 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0627\u0644\u062A\u064A \u0643\u0646\u062A \u0642\u062F \u062A\u0643\u0648\u0646 \u0623\u0648 \u0644\u0627 \u062A\u0639\u062F\u064A\u0644.', index: 2277},
