    'mail_footer.FooterMail_01_Support': {value: '<p>\u0646\u0634\u0643\u0631\u0643 \u0639\u0644\u0649 \u0627\u0633\u062A\u062E\u062F\u0627\u0645 OLX,<br /><strong>\u0641\u0627\u0646 OLX \u0641\u0631\u064A\u0642</strong><br /><br />\u0627\u0630\u0627 \u0643\u0646\u062A \u0645\u0646 \u0627\u064A \u0648\u0642\u062A \u0645\u0636\u0649 \u0641\u064A \u062D\u0627\u062C\u0629 \u0627\u0644\u0649 \u062F\u0639\u0645 \u0627\u0648 \u062A\u0639\u0644\u064A\u0642\u0627\u062A \u0642\u062F \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0646\u0627 \u060C  <<CONTACTLINK>> \u0648\u0627\u0644\u0643\u062A\u0627\u0628\u0629 \u0627\u0644\u064A\u0646\u0627 \u0639\u0644\u0649 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u0627\u0644\u0627\u0644\u0643\u062A\u0631\u0648\u0646\u064A\r<</CONTACTLINK>></p>', index: 4336},
