    'mail_crm.AntiFraudInfo': {value: '<p style="padding: 0pt 5px;">\u0648\u0644\u0644\u062D\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0632\u064A\u062F \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u060C \u0632\u0648\u0631\u0648\u0627 <a href="<<ForumLink>>">\u0645\u0643\u0627\u0641\u062D\u0629 \u0627\u0644\u063A\u0634 \u0627\u0644\u0645\u0646\u062A\u062F\u0649 \u0647\u0646\u0627</a> \u0644\u0645\u0632\u064A\u062F \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0623\u0648 \u0639\u0644\u0649 \u0633\u0644\u0627\u0645\u0629 \u0627\u0644\u0646\u0635\u0627\u0626\u062D <a href="<<Help26Link>>">\u0627\u0636\u063A\u0637 \u0647\u0646\u0627</a>.</p>', index: 4542},
    'mail_crm.CongratulationsForPostingYourFirstAdOnBrand': {value: '<p><strong>\u062A\u0647\u0627\u0646\u064A\u0646\u0627 \u0639\u0644\u0649 \u0627\u062A\u0645\u0627\u0645 \u0627\u0644\u0635\u0641\u0642\u0629 \u0639\u0644\u0649 \u062D\u0633\u0627\u0628\u0643 \u0627\u0644\u0627\u0648\u0644 OLX: <<ItemTitle>></strong></p>', index: 4543},
