    'mail_crm2.crm_ContactSeller_Body2': {value: '<li_10px><strong>\u0647\u062F\u0627\u064A\u0627 \u0645\u062C\u0627\u0646\u064A\u0647</strong> rvs \u0645\u062B\u0644 \u0627\u0644\u0633\u064A\u0627\u0631\u0627\u062A \u0648\u0627\u0644\u062F\u0631\u0627\u062C\u0627\u062A \u0627\u0644\u0646\u0627\u0631\u064A\u0647 \u060C \u0627\u0631\u0628\u0639\u0629 \u0639\u062C\u0644\u0629 \u060C \u0642\u064A\u0645\u0629 \u0627\u0644\u062D\u064A\u0648\u0627\u0646\u0627\u062A \u060C \u0627\u0644\u062E. <strong>\u0644\u0627 \u0648\u062C\u0648\u062F \u0644\u0647\u0627</strong>.<br />\r\u0648\u0647\u0630\u0647 \u0627\u0644\u062D\u064A\u0644 \u060C \u0648\u0644\u0627 \u0633\u064A\u0645\u0627 \u0627\u0630\u0627 \u0643\u0627\u0646 [\u0627\u0644\u0645\u0632\u064A\u0641] \u0627\u0644\u0633\u0644\u0639 \u0645\u0646 \u0628\u0644\u062F \u0622\u062E\u0631 \u0648\u0627\u0646\u062A "\u0644\u0627 \u062A\u062F\u0641\u0639 \u0633\u0648\u0649" \u0627\u0646 \u062A\u0643\u0644\u0641\u0629 \u0627\u0644\u0646\u0642\u0644 \u0627\u0644\u0628\u062D\u0631\u064A.</li_10px>\r\r<li_10px><strong>\u0644\u0627 \u0634\u0631\u0627\u0621</strong> \u0648\u0633\u064A\u0644\u0629 \u0627\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0628\u0627\u0626\u0639 \u064A\u062F\u0639\u064A\u0647\u0627 \u0644\u064A\u0633 / \u0644\u0645 \u062A\u0639\u062F \u0645\u0648\u062C\u0648\u062F\u0629 \u0641\u064A \u0628\u0644\u062F\u0643\u0645 (\u0644\u0633\u0628\u0628 \u0645\u0646 \u0627\u0644\u0627\u0633\u0628\u0627\u0628).</li_10px>\r\r<li_10px>\u0634\u0627\u0634\u0629 \u0645\u0633\u0637\u062D\u0629 \u0627\u0644\u062A\u0644\u0641\u0632\u064A\u0648\u0646\u0627\u062A \u0648\u0622\u0644\u0627\u062A \u0627\u0644\u062A\u0635\u0648\u064A\u0631 \u060C \u0648\u0627\u062C\u0647\u0632\u0629 \u0627\u0644\u0643\u0645\u0628\u064A\u0648\u062A\u0631 \u0627\u0644\u062C\u062F\u064A\u062F\u0629 \u0627\u0644\u062A\u064A \u062A\u0628\u0627\u0639 \u0645\u0639 <strong>50-75 \u066A \u0645\u0646 \u0628\u0644\u062F \u0623\u062C\u0646\u0628\u064A \u060C \u0644\u0627 \u0645\u0648\u062C\u0648\u062F\u0629 \u062D\u0642\u0627</strong>.</li_10px>\r\r<li_10px><strong>\u062A\u0648\u062E\u064A \u0627\u0644\u062D\u0630\u0631</strong> \u0639\u0646 \u0627\u0644\u0628\u0627\u0626\u0639\u064A\u0646 \u0645\u0646 \u0627\u0644\u0627\u062A\u0635\u0627\u0644 \u0628\u0643 \u0645\u0639 \u0627\u0644\u0641\u0642\u0631\u0627\u0621 \u062C\u062F\u0627 \u0627\u0644\u0645\u0647\u0627\u0631\u0627\u062A \u0627\u0644\u0644\u063A\u0648\u064A\u0647. \u0648\u0643\u0642\u0627\u0639\u062F\u0647 \u0639\u0627\u0645\u0629 \u060C \u0644\u0627 \u062A\u0631\u062F \u0639\u0644\u0649 \u0627\u0639\u0644\u0627\u0646\u0627\u062A \u0646\u0634\u0631\u062A \u0641\u064A \u0644\u063A\u0629 \u063A\u064A\u0631 \u0628\u0646\u0641\u0633\u0643.</li_10px>\r\r<li_10px><strong>\u0644\u0627 \u0634\u0631\u0627\u0621 \u062D\u064A\u0648\u0627\u0646\u0627\u062A \u0645\u0646 \u062E\u0627\u0631\u062C \u0628\u0644\u062F\u0643</strong>. \u0627\u0644\u0631\u062C\u0627\u0621 \u0627\u062D\u062A\u0631\u0627\u0645 \u0627\u0644\u0642\u0648\u0627\u0646\u064A\u0646 \u0627\u0644\u062D\u0627\u0644\u064A\u0629. \u064A\u0631\u062C\u0649 \u0645\u0644\u0627\u062D\u0638\u0647 \u0627\u0646 \u0644\u0627 \u0633\u064A\u0645\u0627 \u0627\u0644\u062A\u062C\u0627\u0631\u064A \u0627\u0648 \u0628\u064A\u0639 \u0628\u0639\u0636 "\u0627\u0644\u063A\u0631\u064A\u0628\u0647" \u0627\u0644\u062D\u064A\u0648\u0627\u0646\u0627\u062A \u0645\u062D\u0638\u0648\u0631.</li_10px>\r\r<li_10px><strong>OLX \u0627\u0628\u062F\u0627 \u0648\u064A\u0634\u0627\u0631\u0643 \u0641\u064A \u0627\u0644\u0645\u0639\u0627\u0645\u0644\u0627\u062A \u060C \u062D\u062A\u0649 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0628\u0627\u0626\u0639 \u0645\u0637\u0627\u0644\u0628\u0629 \u0627\u0644\u0639\u0643\u0633</strong>. \u0627\u0630\u0627 \u0643\u0646\u062A \u062A\u062A\u0644\u0642\u0649 \u0645\u062B\u0644 \u0647\u0630\u0647 \u0627\u0644\u0645\u0637\u0627\u0644\u0628\u0629 \u060C \u0639\u0644\u0649 \u0627\u0644\u062A\u062D\u0631\u0643 \u0644\u0644\u062A\u0648.\r\t<ol_in_ul>\r\t\t<li>\u0648\u0646\u062D\u0646 \u0644\u0627 \u062A\u062F\u062E\u0644 \u0641\u064A \u0627\u0644\u0645\u0641\u0627\u0648\u0636\u0627\u062A \u060C \u0627\u0648 \u0627\u0646\u062C\u0627\u0632 \u0627\u0644\u0645\u0639\u0627\u0645\u0644\u0627\u062A.</li>\r\t\t<li>\u0646\u062D\u0646 \u0644\u0627 \u0646\u0642\u062F\u0645 \u062E\u062F\u0645\u0629 \u062A\u0645\u0648\u064A\u0644 \u060C \u062D\u0645\u0627\u064A\u0647 \u0627\u0644\u0645\u0634\u062A\u0631\u064A \u0627\u0648 \u0627\u0644\u0628\u0627\u0626\u0639 \u0627\u0635\u062F\u0627\u0631 \u0627\u0644\u0634\u0647\u0627\u062F\u0627\u062A.</li>\r\t\t<li>\u0627\u0630\u0627 \u0643\u0646\u062A \u062A\u062A\u0644\u0642\u0649 \u0627\u0644\u0628\u0631\u064A\u062F \u0627\u0644\u0627\u0644\u0643\u062A\u0631\u0648\u0646\u064A \u0627\u064A \u0645\u0627 \u064A\u0628\u062F\u0648 \u0645\u0646 \u0627\u0646 \u064A\u0623\u062A\u064A \u0645\u0646 olx \u0648\u0636\u0645\u0627\u0646 \u0627\u0644\u0645\u0639\u0627\u0645\u0644\u0647 \u0623\u0648 \u0627\u0644\u0646\u0642\u0644 \u0627\u0644\u0628\u062D\u0631\u064A \u060C \u0648\u0631\u0641\u0636 \u0627\u0644\u0635\u0641\u0642\u0629.</li>\r\t</ol_in_ul>\r</li_10px>', index: 9015},
