    'mail_crm2.DoNotPurchaseAnimalsFromOutsideYourCountry': {value: '<li_10px><strong>\u0644\u0627 \u0634\u0631\u0627\u0621 \u062D\u064A\u0648\u0627\u0646\u0627\u062A \u0645\u0646 \u062E\u0627\u0631\u062C \u0628\u0644\u062F\u0643</strong>. \u0627\u0644\u0631\u062C\u0627\u0621 \u0627\u062D\u062A\u0631\u0627\u0645 \u0627\u0644\u0642\u0648\u0627\u0646\u064A\u0646 \u0627\u0644\u062D\u0627\u0644\u064A\u0629. \u064A\u0631\u062C\u0649 \u0645\u0644\u0627\u062D\u0638\u0647 \u0627\u0646 \u0644\u0627 \u0633\u064A\u0645\u0627 \u0627\u0644\u062A\u062C\u0627\u0631\u064A \u0627\u0648 \u0628\u064A\u0639 \u0628\u0639\u0636 "\u0627\u0644\u063A\u0631\u064A\u0628\u0647" \u0627\u0644\u062D\u064A\u0648\u0627\u0646\u0627\u062A \u0645\u062D\u0638\u0648\u0631.</li_10px>', index: 9019},
