    'mail_crm2.NeverPayTheSellerForDeliveringAnAnimalToYou': {value: '<li_10px><strong>NEVER</strong> pay the seller for delivering an animal to you. The animal most likely does not exist. This is a false pretext to obtain money from you.</li_10px>', index: 9021},
    'mail_crm2.NeverPayThroughWesternUnionEspeciallySomeoneWhoIsAbroad': {value: '<li_10px><strong>NEVER pay through Western Union</strong> especially someone who is abroad.</li_10px>', index: 9022},
