    'advertising.InstructionsAdWords01': {value: '<strong>Dear Advertiser, </strong></ br>Currently we only accept Google network advertising (Google adwords program). </ br>If you don\'t have a google adwords account, you can create one here: <<ADWORDSLINK>></ br>If you already have one, you can select individual sites where your ads will appear by running an AdWords placement-targeted campaign.', index: 9065},
